import { GoogleMap, LoadScript, Marker, MarkerClusterer } from '@react-google-maps/api';

export default function Googlemap({totalLine}) {
    //console.log(totalLine);
    const google = window.google;
    const center = { 
        lat : 37.672481, 
        lng : 128.736743
    };
    const zoom = 14;
    const mapSize = {
        width : '1900px',
        height : '700px',
        margin : '20px'
    };
    
    const marker = totalLine.map(value => {
        return (
            <Marker 
                position={value}
                icon={
                    {
                        url : 'nodepop.png',
                        scale : 1.25
                    }
                }
            />
        )
    });
    return (
        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap center={center} zoom={zoom} mapContainerStyle={mapSize}>
                    {totalLine && marker}
                </GoogleMap>
            </LoadScript>
        </div>
    )
}
